class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setting a valid LocalDate birthDate correctly assigns the value")
	void testSetBirthDateHappyPath() {
		instance.setBirthDate(LocalDate.of(2020, 1, 1));
	}

	@Test
	@DisplayName("Verifies that setting a past date works correctly")
	void testSetBirthDateWithPastDate() {
		instance.setBirthDate(LocalDate.of(1990, 5, 15));
	}

	@Test
	@DisplayName("Verifies that setting birthDate to null is handled (assuming no validation)")
	void testSetBirthDateWithNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Verifies that setting a future date (edge boundary) works correctly")
	void testSetBirthDateWithFutureDate() {
		instance.setBirthDate(LocalDate.of(2050, 12, 31));
	}

	@Test
	@DisplayName("Verifies that getBirthDate returns the correctly set birthDate for a Pet instance")
	void testGetBirthDateReturnsExpectedDate() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2020, 1, 1), result);
	}

